import React from 'react';
import './GIF.css';

const GIF = () => {
  return (
    <div className="content-area">
      <div className="container">
        <img className="gif" src="/Cane walking.gif" alt="Blind person walking with a cane" />
        <div className="overlay-text">
          <p>How do we survive with impaired vision?</p>
        </div>
        <div className="top-right-container">
          <div className="top-right-text">
            <p>Journey of visually impaired adults</p>
            <hr className="separator" />
            <p className="smaller-text">A journey that you might never SEE</p>
          </div>
        </div>
      </div>
      <div id="Prevalence">
        <h2>Keep this question in mind. Let's begin our journey</h2>
      </div>
    </div>
  );
};

export default GIF;
